import React from "react";
import { Cabecalho, Titulo, Botao, SeparadorDiv, SeparadorDivDois  } from "./estiloHome";
import LogoMarca from '../Tela/jh1_branco1.svg'

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <img src={LogoMarca}>Target Music</img>
          <div></div>
          <SeparadorDivDois></SeparadorDivDois>
          <Botao>Sobre </Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Contato</Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Admin</Botao>
        </Cabecalho>
      </header>
      <body></body>
    </div>
  );
}

export default Home;
